import React from "react";

import "./HornedBeast.css";

export default function HornedBeast({
  title,
  image_url,
  description,
  horns,
  _id,
}) {
  return (
    <div className="beast-div">
      <h2>
        {title}
        <span className="horns">Horns = {horns}</span>
      </h2>
      <img className="img" src={image_url} alt={title} />
      <p>{description}</p>
    </div>
  );
}
